import {StyleSheet} from "react-native";

export const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#faa',
        alignItems: 'center',
        justifyContent: 'center',
    },
    viewStyles: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        fontFamily: 'arial',

    },
    textStyles: {
        fontSize: 30,
        fontWeight: 'bold',
        fontFamily: 'arial',
    },
    listcontainer: {
    flex: 1,
    padding: 12,
    flexDirection: 'row',
    alignItems: 'center',
  },
  text: {
    marginLeft: 12,
    fontSize: 16,
  },
  photo: {
    height: 40,
    width: 40,
    borderRadius: 10,
  },
  view: {
    overflowY: 'scroll', flex: 1, backgroundColor: '#2e3742'
  }

});
